import { screenApplication } from '../../../src/handlers/screen-app.mjs'
import { common_services } from '../../../src/utility/common_services/common_services.mjs';
import { common_responses } from '../../utility/common_responses.mjs';
import sinon from 'sinon';

describe('Test screen app handler', () => {
  let mock;

  beforeAll(()=> {
    process.env.Stage = 'test';
    process.env.securityKey = ''; //update UAT security key while running do screening test
  })

  beforeEach(()=> {
    mock = sinon.mock(common_services);  
  })

  // Need to run manually
  it.skip('screening - do screening', async() => {
    mock.expects("sendRequest").once().returns(mockSuccessResponse());      
    const requestParams = {
      httpMethod: 'POST',
      operation: 'screening',
      queryStringParameters: null,
      body: {
        "data": {
            "FirstName": "Dawood",
            "LastName": "Ibrahim",
            "RequestId": "123456",
            "ParentCompany": "SC397",
            "CustomerCategory": "IND",
            "ScreeningCategory": "Initial Screening Master"
        }
      }
    }
    const event = buildRestRequest(requestParams);
    const response = await screenApplication(event)
  
    expect(response.statusCode).toBe(200);      
    mock.verify();
  })

   
  it('Screening App - invalid request body', async() => {    
    const requestParams = {
      httpMethod: 'POST',
      operation: 'screening',
      queryStringParameters: null,
      body: {
        "data": {
          "FirstName": "Dawood",
          "LastName": "Ibrahim",
          "RequestId": "123456",
          "ParentCompany": "SC397",
          "CustomerCategory": "IND",
          "ScreeningCategory": "Initial Screening Master"
        }
      }
    }
    const event = buildRestRequest(requestParams);
    event.body = null;
    const response = await screenApplication(event)
  
    expect(response.statusCode).toBe(500);
    expect(response.body).toBe(`{"error":"Internal Server Error","message":"The server encountered an unexpected condition."}`)
  })

  it('Screening - invalid request data', async() => {    
    const requestParams = {
      httpMethod: 'POST',
      operation: 'screening',
      queryStringParameters: null,
      body: {
        "data": null
      }
    }
    const event = buildRestRequest(requestParams);
    const response = await screenApplication(event)
  
    expect(response.statusCode).toBe(400);
    expect(response.body).toBe(`{\"error\":\"Bad Request\",\"message\":\"Mandatory fields are missing / invalid\"}`)
  })

  const mockSuccessResponse = () => {
    return [
        200,
        "<?xml version=\"1.0\" encoding=\"utf-16\"?>\r\n<A64EncryptedResponseModel xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\">\r\n  <SessionKey></SessionKey>\r\n  <ResponseData></ResponseData>\r\n  <RequestId>123456</RequestId>\r\n<Signature xmlns=\"http://www.w3.org/2000/09/xmldsig#\"><SignedInfo><CanonicalizationMethod Algorithm=\"http://www.w3.org/TR/2001/REC-xml-c14n-20010315\" /><SignatureMethod Algorithm=\"http://www.w3.org/2001/04/xmldsig-more#rsa-sha256\" /><Reference URI=\"\"><Transforms><Transform Algorithm=\"http://www.w3.org/2000/09/xmldsig#enveloped-signature\" /></Transforms><DigestMethod Algorithm=\"http://www.w3.org/2001/04/xmlenc#sha256\" /><DigestValue>+UxKvdD+BREtp1gQPQMbuaSPxGarAFfWFWTgsMHPLRM=</DigestValue></Reference></SignedInfo><SignatureValue></SignatureValue><KeyInfo><X509Data><X509SubjectName>E=support@tssconsultancy.com, CN=www.tssconsultancy.com, OU=\"Software \", O=TSS Consultancy Private Limited, L=Mumbai, S=Maharashtra, C=IN</X509SubjectName><X509Certificate></X509Certificate></X509Data></KeyInfo></Signature></A64EncryptedResponseModel>"
    ];
  }

  function buildRestRequest(requestParams) {
    const eventRequest = {
      "body": JSON.stringify(requestParams.body),
      "headers": {
        "Host": "localhost:3000"
      },
      "httpMethod": requestParams.httpMethod,
      "isBase64Encoded": false,
      "path": `/${requestParams.operation}`,
      "queryStringParameters": requestParams.queryStringParameters
    }
    return eventRequest;
  }
})